Commit Message:
Provide "canned" object track state adapter

Add a "canned" adapter for iterating over track states as object track
states. This allows consumers of an object track to write a simple range
transform expression rather than needing to explicitly cast the track
state.

Before:
  for ( auto sp : track )
  {
    auto osp = std::dynamic_pointer_cast< object_track_state >( sp );
    ...
  }

After:
  for ( auto osp : track | as_object_track )
  {
    ...
  }
